(60, '2022-12-23 10:06:46', 'AboutTNG', 'Kamera Electronic Traffic Law Enforcement (ETLE) sudah terpasang di Jalan Daan Mogot depan McD Strada Kota Tangerang dan telah dalam tahap uji coba oleh Polres Metro Tangerang Kota. Yuk selalu patuhi aturan lalu lintas supaya gak dapat surat tilang online dari polisi üòÅ https://t.co/P6H0cVKhpk', 'Electronic Traffic Law Enforcement (ETLE) camera has been installed on Jalan Daan Mogot in front of McD Strada Tangerang City and has been in the trial stage by the Tangerang City Metro Police. Let\'s always obey the traffic rules so that you don\'t get an online ticket from the police üòÅ https://t.co/p6h0cvkhpk'),
