(75, '2022-12-21 11:45:31', 'ditlantas_gtlo', 'PELAYANAN KONFIRMASI TILANG  ETLE.\nSubdit Gakkum Ditlantas Polda Gorontalo melaksanakan pelayanan konfirmasi Tilang Elektronik atau ETLE dari pelanggar yang datang langsung ke ruang konfirmasi Etle Ditlantas Polda Gorontalo, Rabu (21/12/2022).\nhttps://t.co/h7bD7R0kIk', 'Etle Ticket Confirmation Service. \n The Gorontalo Regional Police Gakkum Subdit Ditlantas carried out electronic or ETLE ticket confirmation services from violators who came directly to the Etle Ditlantas Gorontalo Regional Police confirmation room, Wednesday (12/21/2022). \n https://t.co/h7bd7r0kik'),
(76, '2022-12-21 06:56:23', 'derasdotid', 'Direktur Lalu Lintas Polda Metro Jaya Kombes Latif Usman mengatakan sistem tilang elektronik (ETLE mobile), rata-rata menjaring 250 kendaraan yang melanggar lalu lintas per hari. Jumlah tersebut relatif bergantung pada kondisi dan lokasi jalanannya.\n\nhttps://t.co/ysINLowQFd', 'Metro Jaya Police Traffic Director Kombes Latif Usman said the electronic ticket system (Etle Mobile), on average netted 250 vehicles that violated traffic per day. The amount is relatively dependent on the conditions and location of the road. \n\n https://t.co/ysinlowqfd'),
(77, '2022-12-21 03:12:21', 'poldabengkulu', 'Hai Sobat Polri\n\nPenerapan tilang elektronik atau Electronic Traffic Law Enforcement (ETLE) sudah berlaku. Bahkan, terbaru Kapolri melarang tilang manual dalam penindakan pelanggaran lalu lintas.\n\nKalau Sobat Polri, lebih pilih ditilang manual atau ETLE saja? https://t.co/2s5of7Pc1N', 'Hi friend of the National Police \n\n The application of electronic tickets or electronic traffic law enforcement (ETLE) is applicable. In fact, the latest National Police Chief prohibits manual tickets in the action of traffic violations. \n\n If you are Polri, prefer manual or Etle? https://t.co/2s5of7pc1n'),
