(94, '2022-12-17 13:47:42', 'NjSamingun', 'Kapolsek Pangkalan Balai Iptu samingun,s.ip mengikuti rapat murenbang dikantor camat sembawa sekaligus mensosialisasikan sistem penilangan  dg etle\n#Polripresisi\n#poldasumsel\n#Kapoldasumsel\n#polresbanyuasin\n#kapolresbanyuasin https://t.co/HVl6TywQpX', 'Pangkalan Balai Iptu Samingun Police Chief, S.IP attended the Murenbang meeting at the Sembawa Sub -District Head at the same time to socialize the disappearance system with Ethle \n #Polripresisi \n #Poldasumsel \n #Kapoldasumsel \n #Polresbanyuasin \n #kapolresbanyuasin https://t.co/hvl6tywqpx'),
(95, '2022-12-17 13:38:53', 'NjSamingun', 'Kapolsek pangkalan balai Iptu Samingun,s.ip mengadakan sambang dan silaturahmi dg kades sembawa sekaligus membicarakan kegiatan penyuluhan masalah penilangan etle\n#Polripresisi\n#poldasumsel\n#Kapoldasumsel\n#polresbanyuasin\n#kapolresbanyuasin\n#Polsekpangkalanbalai https://t.co/KoTTbqWZVL', 'Pangkalan Police Chief of Balai Iptu Samingun, S.IP held a sambang and friendship with the village head of Sembawa as well \n #Polripresisi \n #Poldasumsel \n #Kapoldasumsel \n #Polresbanyuasin \n #Kapolresbanyuasin \n #Polsekpangkalanbalai https://t.co/kottbqwzvl'),
