(110, '2022-12-15 06:56:52', 'Polsek_Muaradua', 'Polda sumsel polres okus polsek muaradua Kapolsek muaradua sosialusasikan Etle dgn sarana Benner #polisi_indonesia #humaspolri #poldasumsel https://t.co/fWw1dyHtwK', 'South Sumatra Regional Police Okus Police Muaradua Police Chief Muaradua socialized Etle with Sarana Benner #Polisi_Indonesia #Humaspolri #Poldasumsel https://t.co/fww1dyhtwk'),
(111, '2022-12-14 06:33:59', 'PolsekKuntoDs', 'BKO Lantas Polsek Kunto Ds melaksanakan Giat Penegakan Hukum Lantas secara Humanis dengan Pemanfaatan ETLE di Wilhum Polsek Kunto Darussalam.\n\n@upank_pangucap\n@dikyasa_rohul2\n@HumasPoldaRiau\n@ResRohul\n@Polripresisi\n@indo_pol\n\n#polripresisi\n#polisi_indonesia https://t.co/JxOdEIn4OC', 'BKO then the Kunto DS Sector Police carried out the law enforcement and then humanistically with the use of Etle in Wilhum Kunto Darussalam Police Station. \n\n @upank_pangucap \n @Dikyasa_Rohul2 \n @Humaspoldariau \n @Resrohul \n @Polripresisi \n @indo_pol \n\n #Polripresisi \n #polisi_indonesia https://t.co/jxodein4oc'),
(112, '2022-12-14 01:02:04', 'masbudiharyanto', 'Bayar pajak di Samsat diblokir krn ETLE, ditanya kena ETLE-nya dimana ga tau, di-check di Samsat bayar tdk ada ETLE di wilayahnya, harus ke Gatot Subroto, trus apa artinya ETLE, kok jd kayak tilang yg didigitalkan, hapus saja E-nya. @NTMCLantasPolri', 'Paying taxes at Samsat is blocked because Etle, asked about Ethle where he doesn\'t know, in the samsat there is no Etle in the region, must go to Gatot Subroto, then what does ETLE mean, how come it\'s like a digital ticket, just delete E- his. @Ntmclantaspolri');
INSERT INTO `dataset_etle` (`id`, `date`, `user`, `tweet`, `translate`) VALUES
(113, '2022-12-13 03:03:38', 'NjSamingun', 'Etle adalah penegakan hukum\nAda beberapa kelebihan dan manfaat etle:\n-ketepatan dan kecepatan capture/ bidikan kamera pelanggar\n-siap sedia 24 jam\n-mengurangi kerja perugas\n-tidak berhadapan dg petugas (tidak bisa damai ditempat)\n-menghindari pungli karna bayar denda melalui atm https://t.co/RemgivbEgp', 'ETLE is law enforcement \n There are several advantages and benefits of ETLE: \n -speed and speed of capture/ camera of violators \n -Apos available 24 hours \n -Reducing the work of the assignment \n -No face to face with officers (cannot be peaceful in place) \n -Avoiding extortion because of paying a fine through ATM https://t.co/remgivbegp'),
(114, '2022-12-13 02:28:56', 'PPangkalanbala1', 'Sosialisasi ETLE &amp; Aplikasi Smart City Banyuasin Dulur Kito\n#polripresisi \n#poldasumsel \n#polresbanyuasin \n#polsekpangkalanbalai @ Polres Banyuasin https://t.co/SzRodUIUJS', 'Etle & amp; Smart City application Banyuasin Dulur Kito \n #Polripresisi \n #Poldasumsel \n #Polresbanyuasin \n #polsekpangkalanbalai @ banyuasin police https://t.co/szroduijs'),
(115, '2022-12-13 02:07:06', 'NjSamingun', 'Kapolsek pangkalan balai Iptu Samingun,S.ip mengikuti acara sosialisasi etle dan pembayaran denda dan dampaknya terhadap kendaraan bila denda tidak dibayar\n\n#Polripresisi\n#poldasumsel\n#Kapoldasumsel\n#polresbanyuasin\n#kapolresbanyuasin\n#Polsekpangkalanbalai https://t.co/y3QyizPMKo', 'Pangkalan Balai Iptu Samingun Police Chief, S.IP attended the Etle Socialization event and the payment of fines and their impact on the vehicle if the fine was not paid \n\n #Polripresisi \n #Poldasumsel \n #Kapoldasumsel \n #Polresbanyuasin \n #Kapolresbanyuasin \n #Polsekpangkalai https://t.co/y3qyizpmko'),
(116, '2022-12-12 23:33:11', 'NjSamingun', 'Babinkamtibmas desa langkan aiptu akhmaf sayuti mengadakan sanjo dan tatap muka terhadap masyarakat desa langkan sekaligus pengenalan penerapan etle dan tertib berlalulintas\n#Polripresisi\n#poldasumsel\n#Kapoldasumsel\n#polresbanyuasin\n#kapolresbanyuasin\n#Polsekpangkalanbalai https://t.co/FtrWoKmoiu', 'Babinkamtibmas Desa Lukang Aiptu Akhmaf Sayuti held Sanjo and face to face to the people of the village as well as the introduction of the application of ETLE and Orderly Traffic \n #Polripresisi \n #Poldasumsel \n #Kapoldasumsel \n #Polresbanyuasin \n #Kapolresbanyuasin \n #Polsekpangkalanbalai https://t.co/Ftrwokmoiu'),
(117, '2022-12-10 03:05:07', 'sepenggal_info', 'Pemasangan ETLE di kawasan simpang GOR Sawah Lebar dan Simpang Lima Ratu Samban Kota Bengkulu. \n\nsource gambar : Story SSCI Bengkulu \n\n#ETLE @ Bengkulu, Bengkulu https://t.co/cfen3JsLEO', 'Installation of Etle in the Sawah Lebar Simpang Gor area and Simpang Lima Ratu Samban Bengkulu City. \n\n Source Image: Story SSCI Bengkulu \n\n #Etle @ Bengkulu, Bengkulu https://t.co/cfen3jsleo'),
(118, '2022-12-09 05:15:43', 'SatLantasTngkot', 'Polres Metro Tangerang Kota akan menerapkan tilang elektronik dan memasang kamera electronic traffic laws enforcement (ETLE) di 4 titik tahun 2023.\n\nüîπÔ∏èJPO Tangcity\nüîπÔ∏èTL Puspem Timur\nüîπÔ∏èTL Cipondoh\nüîπÔ∏èJPO Kb. Nanas https://t.co/Qwmw7im4iT', 'Tangerang City Metro Police will implement electronic tickets and install Electronic Traffic Laws Enforcement (ETLE) cameras in 4 points in 2023. \n\n üîπÔ∏èJPO TANGCITY \n üîπÔ∏èTL East Puspem \n üîπÔ∏èTL Cipondoh \n üîπÔ∏èJPO KB. Pineapple https://t.co/qwmw7im4it'),
(119, '2022-12-09 02:33:19', 'LinggauWang', 'ETLE HADIR DI LUBUKLINGGAU\nDalam rangka mendukung kegiatan penindakan pelanggaran di bidang lalu lintas dan angkutan jalan, Polres Lubuklinggau segera menerapkan sistem tilang elektronik atau ETLE dan nantinya digunakan sebagai alat bukti di pengadilan\n#polripresisi https://t.co/I2KRSuNvTD', 'ETLE is present in Lubuklinggau \n In order to support the activity of enforcement of violations in the field of traffic and road transportation, the Lubuklinggau Regional Police immediately implements an electronic ticket system or Etle and later used as evidence in the court \n #polripresisi https://t.co/i2krsunvtd'),
(120, '2022-12-09 02:33:00', 'LinggauWang', 'PENGECEKAN DAN PENGAWASAN PENGERJAAN KAMERA ETLE\nKabag Log bersama Kasi Was Polres Lubuklinggau melakukan pengecekan dan pengawasan pengerjaan kamera ETLE di wilkum Polres Lubuklinggau dan memastikan pemasangan tiang pemasangan ETLE sesuai  dengan ketentuan\n#polripresisi https://t.co/EXBu9ppUgN', 'Checking and supervision of the Etle camera workmanship \n Head of Log, together with Kasi Was Lubuklinggau Regional Police, checking and supervising the work of Etle cameras at the Lubuklinggau Police Station and ensuring the installation of Etle installation pole in accordance with the provisions \n #polripresisi https://t.co/exbu9ppuggn'),
(121, '2022-12-09 01:32:05', 'Wahyudi47294701', 'Sosialisasi ETLE di LPPL RADIO SUARA BANYUASIN\n\n#kapoldasumsel\n#poldasumsel\n#polresbanyuasin\n#kapolresbanyuasin\n#quickwinspresisipolresbanyuasin https://t.co/zJgVSNUUF3', 'ETLE Socialization on LPPL Radio Suara Banyuasin \n\n #Kapoldasumsel \n #Poldasumsel \n #Polresbanyuasin \n #Kapolresbanyuasin \n #quickwinspresipolresbanyuasin https://t.co/zjgvsnuuf3'),
(122, '2022-12-09 01:12:18', 'berita_jasa', 'PENGECEKAN DAN PENGAWASAN PENGERJAAN KAMERA ETLE\n.\n.\nKabag Log bersama Kasi Was Polres Lubuklinggau melakukan pengecekan dan pengawasan pengerjaan kamera ETLE di wilkum Polres Lubuklinggau dan memastikan pemasangan tiang pemasangan ETLE sesuai  dengan ketentuan\n\n#polripresisi https://t.co/azzKHa6Trv', 'Checking and supervision of the Etle camera workmanship \n . \n . \n Head of Log, together with Kasi Was Lubuklinggau Regional Police, checking and supervising the work of Etle cameras at the Lubuklinggau Police Station and ensuring the installation of Etle installation pole in accordance with the provisions \n\n #polripresisi https://t.co/azzkha6trv'),
(123, '2022-12-09 01:11:36', 'berita_jasa', 'ETLE HADIR DI LUBUKLINGGAU\n.\n.\nDalam rangka mendukung kegiatan penindakan pelanggaran di bidang lalu lintas dan angkutan jalan, Polres Lubuklinggau segera menerapkan sistem tilang elektronik atau ETLE dan nantinya digunakan sebagai alat bukti di pengadilan\n\n#polripresisi https://t.co/RAqXddpGNP', 'ETLE is present in Lubuklinggau \n . \n . \n In order to support the activity of enforcement of violations in the field of traffic and road transportation, the Lubuklinggau Regional Police immediately implements an electronic ticket system or Etle and later used as evidence in the court \n\n #polripresisi https://t.co/raqxddpgnp'),
(124, '2022-12-08 13:51:18', 'ditlantas_gtlo', 'Untuk memaksimalkan penyebaran informasi terkait ETLE, Ditlantas Polda Gorontalo melakukan sosialisasi di lingkungan mahasiswa melalui program Kampus Pelopor Keselamatan dalam rangka sosialisasi ETLE di Universitas Bina Mandiri.\nhttps://t.co/9yhfH6UstL', 'To maximize the dissemination of information related to Etle, Ditlantas Gorontalo Regional Police conducted a socialization in the student environment through the Pelopor Safety Campus Program in the context of Etle Socialization at Bina Mandiri University. \n https://t.co/9yhfh6ustl'),
