(224, '2022-09-22 22:36:34', 'Humaspolsektas1', 'HUT Lantas ke-67, Kapolri Resmikan Program Prioritas ETLE Nasional di 34 Polda \n\nJakarta - Kapolri Jenderal Listyo Sigit Prabowo menghadiri syukuran perayaan Hari Ulang Tahun ke-67 lalu lintas bhayangkara (HUT Lantas) di Gedung Korlantas Polri, Jakarta, Kamis, 22 September 2022. https://t.co/sG3ieth0DP', 'The 67th Anniversary of the National Police Chief Inaugurated the National Etle Priority Program in 34 Polda \n\n JAKARTA - National Police Chief Gen. Listyo Sigit Prabowo attended the celebration of the 67th Anniversary of Bhayangkara Traffic (Hut Lantas) at the Korlantas Polri Building, Jakarta, Thursday, September 22, 2022. https://t.co/sg3ieth0dp'),
