(242, '2022-08-19 09:12:46', 'satlantas_mglta', 'Pasalnya setelah tercapture kamera Etle melakukan pelanggaran kasat mata, untuk surat Konfirmasi Etle justru diterima oleh pemilik Asli Nomor Polisi yang Asli dan bukan diterima oleh pelanggar.', 'The reason is that after the Ethle camera is captured, the invisible violation of the eye, for the Etle confirmation letter is actually received by the original owner of the original police number and not received by violators.'),
