(302, '2021-11-20 06:22:41', 'yadiadi12', 'Saya sdh ke posko etle di pancoran, petugasnya bilang harus confirm ke bank BRI, padahal transaksi pembayaran sdh sukses.. Mohon bantuannya terkait hal ini.. Karena saya sdh bolak balik ke bank BRI nya.. Apakah disistem ETLE tidak bisa mengecek pembayaran saya? @TMCPoldaMetro', 'I have been to the Etle post in Pancoran, the officer said that I had to confirm to the BRI bank, even though the payment transaction was successful ... please help with this matter ... because I have been going back and forth to the BRI bank ... does the Etle system not check my payment? @Tmcpoldametro'),
(303, '2021-11-10 14:58:42', 'KinGTomverse', 'Silahkan cek denda ETLE kendaraan anda disini:\nüëâ https://t.co/m39gfDGT3T\n\nAlhamdulillah kendaraan saya bebas denda üòä https://t.co/r3olH0crNC', 'Please check your vehicle etle fine here: \n üëâ https://t.co/m39gfdgt3t \n\n Alhamdulillah, my vehicle is free to fine üòä https://t.co/r3olh0crnc'),
(304, '2021-10-21 02:56:06', 'PolrestaSleman', 'Sosialisasi Etika Berlalulintas dan ETLE In Hand di Terminal Condongcatur bertujuan untuk pengenalan kepada masyarakat pengguna jalan agar mengetahui adanya sistem ETLE in Hand sehingga tetap tertib dalam berlalulintas serta mematuhi aturan yang berlaku dan selalu mematuhi prokes https://t.co/dYzl7oarqS', 'Traffic Ethics Socialization and Etle In Hand in Condongcatur Terminal aims to introduce the community of road users to know the existence of an Etle In Hand system so that it remains orderly in traffic and comply with the applicable rules and always comply with Prokes https://t.co/dyzl7oarqs'),
