(306, '2021-09-24 20:23:59', 'HeryW2757', '@TMCPoldaMetro Selamat Pagi Pak/Bu Polisi, saya pernah terkena pelanggaran ETLE sekitar bulan 5 kemarin, dan sudah saya bayarkan lewat online. Apakah STNK saya masih terkena blokir? Kabarnya jika kena tilang dan sudah dibayarkan harus datang ke Polda buat buka blokir?', '@TmcpoldaMetro Good morning sir/police, I have been hit by Etle violations around the 5th month yesterday, and I have paid it through online. Is my STNK still blocked? Reportedly, if you get a ticket and have been paid, you have to come to the Regional Police to unblock?'),
(307, '2021-09-07 15:56:31', 'JihyosHusband_', 'Itu E Tle ada di Margonda bagian Selatan UDAH DISITU DOANG.\n\nTKP gw di Margo City bagian Utara. KAGAK ADA ETLE DISITU. https://t.co/acFc1IhIR7', 'That E Tle is in the southern part of Margonda there is already there. \n\n My crime scene at Margo City northern part. There\'s no Etle there. https://t.co/acfc1ihir7'),
(308, '2021-09-05 06:32:41', 'lantas_ngada', 'roadsafety_policing ROAD SAFETY POLICING\nSuatu Pendekatan Kepolisian Dalam Menangani Lalu Lintas Dalam Pendekatan Road Safety\n\n#chryshnandadwilaksana #roadsafety_policing #divisihumaspolri #NTMCLantasPolri #dikmaslantaspolri #irsmm #rasirosakorlantas #polripresisi #etle https://t.co/7F5ToXpVvt', 'roadsafety_policing road safety policing \n A police approach in handling traffic in the road safety approach \n\n #CHRYSHNANDADWILANCEKAN #ROADSAFETY_POLICING #Divisihumaspolri #ntmclantaspolri #dikmaslantaspolri #IRSMM #Rasirosakorlantas #Polripresisi #etle https://t.co/7f5toxpvvt'),
(309, '2021-09-01 14:15:48', 'eddie_toyota', 'Mulai minggu ini akan berlaku penindakan tilang baik dengan kamera ETLE, maupun tilang manual apabila ditemukan (pelanggar) secara langsung oleh anggota yang bertugas pada hari itu.\n\nMore Info :\nüìû call : 088211567518\n *Member Of Astra*\n\nhttps://t.co/qIF07AbUp2', 'Starting this week a ticket action will apply to either ETLE cameras, as well as manual tickets if found (violators) directly by members on duty that day. \n\n More info: \n üìû Call: 088211567518 \n  *Member of Astra* \n\n https://t.co/qif07abup2'),
