(313, '2021-07-05 03:00:07', 'SatMakassar', 'Mari Bersama Patuhi PPKM Darurat Untuk Memutus Rantai Penyebaran Covid 19 ( Khusus Saudara Kita Yang Berada Di Jawa Dan Bali üôè)\n\nSayangi Diri Sendiri &amp; Keluarga Tercinta\n\n#ppkm #polripresisi #etle #roadsafety #korlantaspolriuntukindonesia #korpslalulintas #roadsafetyzeroaccident https://t.co/D2Qza0Be3Z', 'Let\'s follow the Emergency PPKM to break the Covid 19 Distribution Chain (especially our brothers in Java and Bali üôè) \n\n Dear yourself & amp; Beloved family \n\n \"'),
