(316, '2021-05-29 18:28:45', 'Jbxl311', 'Jadi kesimpulannya kalo kena tilang ETLE sebaiknya ga usah pake opsi penyelesaian BRIVA karena sifatnya kita nitip uang denda maksimal yang relatif banyak, langsung pake opsi sidang aja nanti bayar langsung di tempat.', 'So the conclusion is that if you get a ticket Etle you should not have to use the Briva settlement option because it is in nature we get a relatively large maximum fine, just use the session option, then pay directly on the spot.'),
(317, '2021-05-27 14:10:00', 'kp_polsek', 'Mobile ETLE atau Kamera Tilang Bergerak akan mulai dilaksanakan per 1 Juni 2021\n\nJalan Slamet Riyadi hingga Jalan Gajah Mada akan menjadi kawasan Zero Tolerance\n\n#polrestasamarinda\n#poldakaltim\n#divisihumaspolri https://t.co/NLXukw09Nh', 'Mobile Eth or Moving Ticket Camera will start on June 1, 2021 \n\n Jalan Slamet Riyadi to Jalan Gajah Mada will become the Zero Tolerance area \n\n #polrestasamarinda \n #poldakaltim \n #divisihumaspolri https://t.co/nlxukw09nh'),
(318, '2021-05-20 05:36:48', 'PParingin', 'Polri Libatkan PT Pos Untuk Optimalkan E-Tilang (ETLE)\n\nKorlantas Polri secara resmi telah meluncurkan 244 kamera Electronic Traffic Law Enforcement (ETLE) tahap I di 12 Polda. Peresmian tilang elektronik di 12 Polda ini dipimpin langsung oleh Kapolri. https://t.co/8qFVXN8oTb', 'Polri involved PT Pos to optimize e-ticketing (ETLE) \n\n The National Police Korlantas has officially launched 244 Electronic Traffic Law Enforcement (ETLE) Phase I cameras in 12 Polda. The inauguration of the electronic ticket in 12 Polda was led directly by the National Police Chief. https://t.co/8qfvxn8otb'),
(319, '2021-05-16 11:59:41', 'SatMakassar', 'TUNDA DULU WISATANYA\n\nJika tidak ada kebutuhan mendesak tetaplah berada di rumah\n\n#SatMakassar #DiskominfoMKS #polripresisi #etle #roadsafety #korlantaspolriuntukindonesia #korpslalulintas #roadsafetyzeroaccident #dikmaslantaspolri #zeroaccident https://t.co/JS1a818Ws6', 'Delay the tour \n\n If there is no urgent need, keep on being at home \n\n #Satmakassar #diskominfomks #polripresisi #etle #roadsafety #korlantaspolrijutIndonesia #korpslalalulatas #roadsafetyzeroaccident #dikmaslantaspolri #zeroaccident https://t.co/js1a818ws6'),
(320, '2021-05-07 06:39:09', 'ADISUJONO01', 'Seperti sudah menjadi budaya, mau tertib kalau ada petugas yang ada di lokasi.\nInilah gunanya etle, agar mental berubah..\nMasih harus dipaksa dengan aturan..\n. https://t.co/cuuo0gkIj9', 'As it has become a culture, you want to be orderly if there are officers at the location. \n This is the point of Ethle, so that the mentality changes .. \n Still have to be forced with rules .. \n . https://t.co/cuuo0gkij9'),
(321, '2021-05-05 10:06:55', 'Ferdianpratamav', 'Udah ban bocor , dapat surat ETLE dan kena 2 pasal sekaligus. Dahh dekat hari raya juga, ü§¶‚Äç‚ôÇÔ∏èü§¶‚Äç‚ôÇÔ∏èü§¶‚Äç‚ôÇÔ∏èü§¶‚Äç‚ôÇÔ∏è', 'Already leaked tires, got Etle letters and hit 2 articles at once. Dahh near the holiday too, ü§¶‚Äç‚ôÇÔ∏èü§¶‚Äç‚ôÇÔ∏èü§¶‚Äç‚ôÇÔ∏èü§¶‚Äç‚ôÇÔ∏è'),
(322, '2021-05-02 13:23:21', 'Superhero_jkt', '@TMCPoldaMetro @DivHumas_Polri , saya mau memberitahukan kepada jajaran polri dan polisi lalu lintas , mohon untuk sistem Etle dapat dalam pembayaran denda tilang di perbaiki saya bayar denda tilang tgl 30 Agustus 2020 waktu itu kenapa masih dalam pemblokiran.', '@Tmcpoldametro @divhumas_polri, I want to notify the ranks of the National Police and the Traffic Police, please for the ETLE system to pay for the ticket fine, I am repaired, I pay the ticket fines on August 30, 2020 at that time why it is still in blocking.'),
(323, '2021-05-02 04:57:45', 'satlantas_mglta', 'TIDAK MUDIK\nKesadaran Untuk Tidak Mudik\nMelindungi Orang terkasih dari Covid-19\n#polripresisi #etle #roadsafety #korlantaspolriuntukindonesia #korpslalulintas #roadsafetyzeroaccident #dikmaslantaspolri #zeroaccident #rambulalulintas #polantas #zebracross #markajalan https://t.co/6pssq9xVcj', 'Not going home \n Awareness not to go home \n Protect loved ones from Covid-19 \n #polripresisi #etle #roadsafety #korlantaspolri forindonesia #korpslallalulalasahafetyzeroaccident #dikmaslantaspolri #zeroaccident #rambulalalalaltas #polantas #zebracross #markalan https://t.co'),
