(325, '2021-04-17 16:08:31', 'satlantas_mglta', 'Reposted from @dikmaslantaspolri TETAP AMAN RAMADHAN DIRUMAH SAJA\nJANGAN MUDIK DULU!!\n\n6-17 Mei 2021\n\n#polripresisi #etle #roadsafety #korlantaspolriuntukindonesia #korpslalulintas #roadsafetyzeroaccident #dikmaslantaspolri #zeroaccident #rambulalulintas #polantas #zebracross https://t.co/5CyJaeX0Qp', 'Reposted from @dikmaslantaspolri remains safe Ramadan at home \n Don\'t go home !! \n\n 6-17 May 2021 \n\n #Polripresisi #etle #roadsafety #korlantaspolri forindonesia #korpslalallalalulujujuzeroaccident #dikmaslantaspolri #zeroaccident #rambulalalalaltas #polantas #zebracross https://t.co/5CYJEX0QP'),
(326, '2021-04-16 06:59:23', 'satlantas_mglta', 'Jaga Diri Jaga Sesama\nPutus Penyebaran Covid - 19\n\nLarangan Mudik 2021\nDimulai 6 - 17 Mei 2021\n#polripresisi #etle #roadsafety #korlantaspolriuntukindonesia #korpslalulintas #roadsafetyzeroaccident #dikmaslantaspolri #zeroaccident #rambulalulintas #polantas https://t.co/o9BUorX3Gq', 'Take care of yourself \n Breaking up the spread of Covid - 19 \n\n MUDIK PROBLEMS 2021 \n Starting 6-17 May 2021 \n #Polripresisi #etle #roadsafety #korlantaspolri forindonesia #korpslallalulalasahafetyzeroaccident #dikmaslantaspolri #zeroaccident #rambulalalalaltas #polantas https://t.co/o9buorx3gq'),
