(331, '2021-04-02 23:40:06', 'adib_setyo', '@ridwanhr Sebelum dibalikin/serah terima, dicek dulu ke situs etle nya. Bersih atau terbukti melanggar. Kan ketahuan kejadiannya kapan.', '@ridwanhr before being reversed/handed over, first checked to the Etle site. Clean or proven violating. It was discovered when it was.'),
(332, '2021-04-01 06:54:05', 'kominfongw', 'Selamat siang #SobatKom, Sistem tilang elektronik atau Electronic Law Enforcement (ETLE) mulai diberlakukan pada Selasa (23/3/2021) secara nasional. Nantinya petugas tidak lagi melakukan tindakan penilangan. https://t.co/2ByxCrrCcC', 'Good afternoon #sobatkom, electronic ticketing system or electronic law enforcement (ETLE) began to be implemented on Tuesday (3/23/2021) nationally. Later the officers will no longer take action. https://t.co/2byxcrrccc'),
(333, '2021-04-01 05:35:04', 'mufthi', 'Dah bebas kopid ya? Terakhir begini awal Maret 2020... atau karena ETLE jadi kehadiran polantas berkurang? https://t.co/NQjFM9d9Ud', 'Are you free? Last this time in early March 2020 ... or because Etle was the presence of Polantas decreased? https://t.co/nqjfm9d9ud'),
(334, '2021-04-01 03:58:02', 'kominfongw', 'Selamat siang #SobatKom, Polda Metro Jaya meluncurkan ETLE Mobile atau tilang elektronik berjalan yang menempel di seragam petugas atau mobil dan motor polisi. Terdapat 244 kamera ETLE yang tersebar di 12 Polda secara nasional. https://t.co/wkcXjdAflm', 'Good afternoon #Sobatkom, Polda Metro Jaya launched Etle Mobile or Electronic Ticket that sticks to the uniform of officers or police cars and motorbikes. There are 244 Etle cameras spread across 12 Polda nationally. https://t.co/wkcxjdaflm');
