(335, '2021-04-01 02:54:46', 'Lantas_lamteng', 'Giat Unit Dikyasa Melaksanakan Binluh dan Sosialisasi Kepada Tukang Parkir Di Plaza Bandar Jaya Kec. Terbanggi Besar Kab. Lampung Tengah Mengenai Protokol Kesehatan, Keselamatan Berlalu Lintas dan Etle\n#ditlantaspoldalampung @lpgditlantas https://t.co/ZsJ0030yD1', 'The Dikyasa Gentiba Unit carried out binluh and socialization to parking attendants at Plaza Bandar Jaya Kec. Terbanggi Besar Kab. Central Lampung regarding health protocols, traffic safety and etle \n #ditlantaspoldalampung @lpgditlantas https://t.co/zsj0030yd1'),
