(337, '2021-03-31 00:52:38', 'kominfongw', 'Selamat pagi #SobatKom, Memastikan penegakan hukum di bidang lalu lintas yang tegas dan transparan, Korlantas Polri meluncurkan 244 kamera Electronic Traffic Law Enforcement (ETLE) pada Tahap I. https://t.co/vlU3Or2CEz', 'Good morning #sobatkom, ensuring law enforcement in the field of strict and transparent traffic, Korlantas Polri launched 244 Electronic Traffic Law Enforcement (ETLE) cameras in phase I. https://t.co/vlu3or2cez'),
(338, '2021-03-30 23:39:57', 'kristian_oka', '@AdiyatJatiW Kan pake ETLE sekarang. Surat tilang dikirim ke rumah. Polisi tidak langsung berhadapan dengan pelanggar, salah satu alasannya agar gesekan polisi-warga sipil bisa ditekan.', '@Adiyatjatiw uses etle now. The ticket was sent to the house. The police are not directly dealing with violators, one of the reasons for the friction of civilians can be reduced.'),
(339, '2021-03-30 01:39:51', 'nita_rossana', 'agak panjang sih.. tapi penting.. video tentang ETLE gaes.. monggo disimak.. https://t.co/mkTanT0rHG', 'It\'s a bit long ... but it\'s important ... a video about ETLE GAES ... Monggo listened to ... https://t.co/mktant0rhg'),
(340, '2021-03-29 15:15:07', 'ghozihanif22', 'Kalo etle udh bener bener rata, dan gada lagi tilang liar yang gajelas, asli orang jd pada males bayar pajak deh', 'If Etle is really correct, and there is another wild ticket that is clear, the original people are lazy to pay taxes'),
(341, '2021-03-29 03:58:02', 'Lantas_lamteng', 'Giat Unit Dikyasa Melaksanakan Binluh dan Sosialisasi Kepada Sopir Angkot Di Plaza Bandar Jaya Kec. Terbanggi Besar Kab. Lampung Tengah Mengenai Protokol Kesehatan, Keselamatan Berlalu Lintas dan Etle\n#ditlantaspoldalampung @lpgditlantas https://t.co/c0WlrQF3Au', 'Enterprisingly Dikyasa Unit carried out binluh and socialization to public transportation drivers at Plaza Bandar Jaya Kec. Terbanggi Besar Kab. Central Lampung regarding health protocols, traffic safety and etle \n #ditlantaspoldalampung @lpgditlantas https://t.co/c0wlrqf3au'),
(342, '2021-03-28 12:52:07', 'lantasokutimur', 'ETLE merupakan Inovasi Polantas dibidang penegakkan hukum. System ini saling terhubung dan terpusat pada KORLANTAS POLRI. Penegakkan hukum secara elektronik menjadi trobosan mutahir untuk mewujudkan Polantas yang modern. https://t.co/OyIkk4CmTT', 'Ethle is a Polantas innovation in the field of law enforcement. This system is connected and centered on the National Police Korlantas. Electronic law enforcement becomes a breakthrough breakthrough to realize a modern traffic police. https://t.co/oyikk4cmtt'),
(343, '2021-03-28 01:39:08', 'sjahrul_wow', '#ETLE\n\nSelalu berusaha mematuhi aturan. Tapi yg melanggar semuanya. Jadinya ikutan. \nDi jalan tol kendaraan jalan dibawah batas minimum. Jalan pelan di jalur kanan. Yg ada orang pada ngebut mendahului di bahu jalan atau jalur no 1. #Bahaya', '#Etle \n\n Always trying to obey the rules. But who violated everything. So follow. \n On the toll road the vehicle is below the minimum limit. Slowly walk in the right lane. There are people in speeding before the shoulder of the road or lane 1. #dangerous'),
(344, '2021-03-28 01:37:04', 'sjahrul_wow', '#ETLE\nKatanya harus ngecek di link tertentu, kalau tidak #STNK diblokir. Katanya juga akan diberitahu dan harus konfirmasi. \n\nBiasa kalau ada aturan sosialisasi lewan SMS blast. Tapi gak terima.', '#Etle \n He said he had to check on a certain link, otherwise #Stnk was blocked. He said he would also be told and had to confirm. \n\n It\'s normal if there are rules for the Socialization of Lelast SMS Blast. But don\'t accept it.'),
(345, '2021-03-28 01:34:17', 'sjahrul_wow', '#ETLE \nTilang elektronik sudah mulai ramai. Belum tahu maknismenya. Hanya tahu katanya. Di medsos juga gak jelas. Biasa pakai bahasa neglantur. Judul dan isi tidak sinkron.', '#Etle \n Electronic tickets have begun to be crowded. Don\'t know the maknismen. Just know he said. In social media is also unclear. Used to use the language of the country. Titles and contents are out of sync.'),
