(435, '2021-03-25 02:43:39', 'elvitarenycahya', '2. Apa bisa saya langsung membayarnya di lokasi Jakarta ?\n3. Kemana saya harus datang untuk menyelesaikan ETLE ?\n4. Persyaratan apa saja yang harus saya lengkapi saat saya datang dan melakukan pembayaran ETLE ? @TMCPoldaMetro', '2. Can I pay it right away at the Jakarta location? \n 3. Where should I come to complete Etle? \n 4. What requirements should I complete when I come and make ETLE payments? @Tmcpoldametro'),
(436, '2021-03-25 02:43:16', 'elvitarenycahya', 'Assalammualaikum\n\nSaya dengan Elvita, saya tinggal di Jakarta Selatan, ingin menanyakan terkait ETLE kendaraan saya nopol Kota Medan, namun rumah yang di Medan tidak ada yang menempati.\n\nPertanyaan saya,\n1. Bagaimana saya mendapatkan lagi surat tilang tersebut ? @TMCPoldaMetro', 'Assalamualaikum \n\n I with Elvita, I live in South Jakarta, want to ask about the Etle of my vehicle Nopol Medan City, but no house in Medan occupies. \n\n My question, \n 1. How do I get the ticket again? @Tmcpoldametro'),
