(439, '2021-03-25 02:31:05', 'polres_seluma', '#ApresiasiETLEPolri Menpan RB katakan ETLE juga bagian dari visi misi Kapolri mewujudkan Polri yang Presisi, Polri yang smart, Polri yang transparan.\n\nPolri Komitmen ciptakan Lalulintas Tertib Aman https://t.co/9sU65vJyDw', '#Apresiasietlepolri Menpan RB said Etle is also part of the vision and mission of the National Police Chief Embanging in the precision National Police, Smart Police, Transparent Polri. \n\n Polri Commitment to Create a Safe Traffic Order Https://t.co/9su65vjydw');
