(440, '2021-03-25 02:30:50', 'SugihPolsek', 'Demi terciptanya Lalulintas Tertib Aman, Korps Lalu Lintas Polri meluncurkan electronic traffic law enforcement (ETLE) nasional tahap pertama untuk meningkatkan keamanan, keselamatan, kelancaran, dan penindakan hukum terhadap pelanggar lalu lintas. \n\n#ApresiasiETLEPolri https://t.co/MRgdKkFBGi', 'For the sake of the creation of a safe traffic, the National Police Traffic Corps launched the first stage of the first phase of Electronic Traffic Traffic Traffic for Safety, Safety, Safety, smooth and legal action against traffic violators. \n\n #APRAPPRESIASLEPOLRI https://t.co/mrgdkkfbgi'),
(441, '2021-03-25 02:25:09', 'SugihPolsek', 'Polri yang presisi,  ETLE merupakan salah satu bentuk nyata polri dalam hal pelayanan masyarakat agar lebih transparan\n#ApresiasiETLEPolri\nLalulintas Tertib Aman https://t.co/ClflCIwDhW', 'The precision Polri, Etle is one of the tangible forms of the National Police in terms of community service to be more transparent \n #AprecietativeLepolri \n Safe orderly traffic https://t.co/clflciwdhw'),
(442, '2021-03-25 02:24:20', 'SugihPolsek', 'Mewujudkan program 100 hari kerja kapolri, ETLE akan ditargetkan beroperasi secara nasional di seluruh wialyah\n#ApresiasiETLEPolri\nLalulintas Tertib Aman https://t.co/PYD3bk3987', 'Realizing the 100 -day Chief of Police, Ethle will be targeted to operate nationally throughout the wialyah \n #AprecietativeLepolri \n Safe Orderly Traffic Https://t.co/pyd3bk3987'),
(443, '2021-03-25 02:23:18', 'SugihPolsek', 'ETLE merupakan salah satu bentuk nyata  visi misi kapolri dengan slogan polri presisi\n#ApresiasiETLEPolri\nLalulintas Tertib Aman https://t.co/6Wai5wPzg2', 'Ether is a tangible form of the vision and mission of the National Police Chief with the Police Precision Slogan \n #AprecietativeLepolri \n Safe traffic order https://t.co/6wai5wpzg2'),
(444, '2021-03-25 02:22:58', 'SugihPolsek', 'ETLE merupakan wujud nyata pelayanan polri kepada masyarakat, yang kedepan diharapkan akan berjalan semakin baik dan efektif\n#ApresiasiETLEPolri\nLalulintas Tertib Aman https://t.co/L0EHvxETUa', 'ETLE is a tangible manifestation of Polri services to the community, which in the future is expected to run better and more effectively \n #AprecietativeLepolri \n Safe traffic order https://t.co/l0ehvxetua'),
