(449, '2021-03-25 01:44:38', 'JogjaUpdate', '#sekhilafinfo\n23 Maret 2021 Electronic Traffic Law Enforcement (ETLE), resmi diluncurkan. Sudah ada 4 titik yang dipasang, yaitu:\nSimpang Ngabean\nSimpang Temon\nSimpang Banguntapan\nSimpang Maguwoharjo', '#Khilafinfo \n March 23, 2021 Electronic Traffic Law Enforcement (ETLE), officially launched. There are already 4 points installed, namely: \n Simpang Ngabean \n Simpang Temon \n Simpang Banguntapan \n Simpang Maguwoharjo'),
