(453, '2021-03-24 10:27:29', 'PoldaJogja', 'KAMPUNG TERTIB LALU LINTAS ???? ü§î\n.\nSelengkapnya bisa anda simak video berikut ini üì∫\n.\n.\n.\n#PoldaJogja #PoldaDIY #DitlantasPoldaDIY #Jogja #ETLE #Indonesia #Presisi @ Special Region of Yogyakarta https://t.co/uBV0Gsfvek', 'Traffic Orderly Village ???? ü§î \n . \n You can refer to the following video üì∫ \n . \n . \n . \n #Poldajogja #poldadiy #ditlantaspoldadiy #jogja #etle #indonesia #pressi @ special region of Yogyakarta https://t.co/ubv0gsfvek'),
(454, '2021-03-24 07:28:37', 'SATLANTASRESBUL', 'KAPOLRES BULUNGAN ARCHERY CHAMPIONSHIP 2021\nTanggal 10 - 11 April 2021.\n#ETLE\n#etlenasional\n#presisi\n#prioritaskapolri\n@irsmm_id @dikmaslantas_ @SATLANTASRESBUL @POLRESBULUNGAN1 https://t.co/eqzmpeg3ep', 'Head of Bulungan Archery Championship 2021 \n April 10 - 11 2021. \n #Etle \n #etlenasional \n #Presidential \n #priority of the police \n @IRSMM_ID @dikmaslantas_ @satlantasresbul @polresbulungan1 https://t.co/eqzmpeg3ep'),
(455, '2021-03-24 06:02:04', 'PujaKus11405675', 'Apakah Kopek itu? Ternyata barang satu ini selalu terpasang di helm petugas Satlantas Polres Wonogiri.\n\nKopek digunakan sebagai perluasan penerapan electronic traffic law enforcement (ETLE). Daerah yang rawan terjadi kecelakaan bakal sering dipatroli oleh petugas. https://t.co/UU9IAagmj6', 'What is KOPEK? It turns out that this one item is always installed in the Wonogiri Police Traffic Unit Helmet. \n\n Kopek is used as an expansion of the application of Electronic Traffic Law Enforcement (ETLE). Areas prone to accidents will often be patrolled by officers. https://t.co/uu9iaagmj6'),
(456, '2021-03-24 04:49:32', 'Azzam04471197', 'Jangan Sampai Kena ETLE Gara-gara Hal Sepele, Yuk Kenali Arti Garis-garis Marka di Jalan - Semua Halaman - GridOto.comq https://t.co/yBPzgshDUn', 'Don\'t get Ethle because of trivial things, let\'s recognize the meaning of markers on the road - All pages - GridOto.comq https://t.co/ybpzgshdun'),
(457, '2021-03-23 16:40:12', 'dodi_74', 'Kamera ETLE dilengkapi dengan Kamera Cerdas (Artificial Intelligent Camera) yang mempunyai APNR (automatic plat number Recognation) yang terhubung dengan ERI, Speed Radar alat untuk mendeteksi Kecepatan kendaraan, dan FRS/Face Recognation System \nhttps://t.co/bYVrJNkve1', 'Etle cameras are equipped with an intelligent camera (artificial intelligent camera) that has an APNR (Automatic Plate Number Recognation) that is connected to Eri, Speed Radar Tool to detect vehicle speed \n https://t.co/byvrjnkve1'),
(458, '2021-03-23 13:06:55', 'TamtomoRudi', 'Polda Jateng Hari Ini Launcing Program ETLE Serentak\n\nKapolda Jateng : Hari Ini Kepolisian Melaunching Program ETLE Di Seluruh Daerah https://t.co/sk6WZvSIVq', 'Central Java Regional Police today Launcing Etle Program Simultaneously \n\n Central Java Police Chief: Today the police launched the ETLE program throughout the region https://t.co/sk6wzvsivq'),
(459, '2021-03-23 11:53:36', 'Corpsnews6', 'Kapolri Resmi Launching ETLE Nasional Tahap 1, Kamera Tilang Elektronik Siap Dioperasikan ‚òõ https://t.co/z9LrIlSwT2 https://t.co/uCsGao8rCn', 'National Police Chief Official Launching Etle National Phase 1, Electronic Ticket Camera Ready to Operate ‚òõ https://t.co/z9lrilswt2 https://t.co/ucsgao8rcn'),
(460, '2021-03-23 09:44:57', 'pelitatoday_com', 'Kapolri Resmi Launching Etle Nasional Tahap 1, 12 Polda Terapkan Tilang Elektronik..\n\n https://t.co/bDD6pe4NQD', 'National Police Chief Official Launching Etle Phase 1, 12 Polda Apply Electronic Tickets .. \n\n  https://t.co/bdd6pe4nqd'),
(461, '2021-03-23 09:04:30', 'WaeMancung', 'Kapolri Resmi Launching Etle Nasional Tahap 1, 12 Polda Terapkan Tilang Elektronik\n\nKapolri Jenderal Polisi Drs. Listyo Sigit Prabowo, https://t.co/14MtRZlP6P., meresmikan tilang elektronik atau Elektronic Traffic law enforcement (ETLE) nasional tahap 1. https://t.co/f94HdvRGgN', 'National Police Chief Official Launching Etle Phase 1, 12 Polda Apply Electronic Tickets \n\n National Police Chief General Police Drs. Listyo Sigit Prabowo, https://t.co/14mtrzlp6p., Inaugurated the Electronic Traffic Law Enforcement (ETLE) National Ticket Phase 1. https://t.co/f94hdvrggn'),
(462, '2021-03-23 08:25:07', 'TamtomoRudi', 'Kapolri Jenderal Polisi Drs. Listyo Sigit Prabowo, https://t.co/KGVf3j3HBV., meresmikan tilang elektronik / Elektronic Traffic law enforcement (ETLE) nasional tahap 1.Dlm launching tahap 1 ini, ada 12 Polda dg 244 kamera tilang elektronik yang bakal dioperasikan mulai hari ini. https://t.co/k1WTLFLcYo', 'National Police Chief General Police Drs. Listyo Sigit Prabowo, https://t.co/kgvf3j3hbv., Inaugurated the Electronic Traffic Law Enforcement (ETLE) NATIONAL PAGU 1.DLM Launching Phase 1 . https://t.co/k1wtlflcyo'),
(463, '2021-03-23 08:06:31', 'satlantas_mglta', 'Budayakan Tertib Lalu Lintas\nStop Menumpang Dibelakang Bak Terbuka\nDapat Membahayakan Diri Sendiri\n#polripresisi #etle #roadsafety #korlantaspolriuntukindonesia #korpslalulintas #roadsafetyzeroaccident #dikmaslantaspolri #zeroaccident #rambulalulintas #polantas #zebracross https://t.co/6lHqzI0xQn', 'Cultivate Traffic Order \n Stop riding behind the pubes \n Can endanger yourself \n #Polripresisi #etle #roadsafety #korlantaspolri forindonesia #korpslallalulalasahafetyzeroaccident #dikmaslantaspolri #zeroaccident #rambulalalalaltas #polantas #zebracross https://t.co/6Lhqzi0XQN'),
(464, '2021-03-23 08:04:18', 'satlantas_mglta', 'Korlantas Polri secara resmi meluncurkan 244 kamera Electronic Traffic Law Enforcement (ETLE) tahap I di 12 Polda. Peresmian dipimpin langsung oleh Kapolri Jenderal Pol Listyo Sigit Prabowo bersama Ketua Mahkamah Agung Muhammad Syarifuddin dan Ketua Jaksa Agung ST Burhanuddin. https://t.co/F1JO7rpK7v', 'The National Police Korlantas officially launched 244 Electronic Traffic Law Enforcement (ETLE) camera in 12 Polda. The inauguration was led directly by the National Police Chief General Pol Listyo Sigit Prabowo together with the Chief Justice of the Supreme Court Muhammad Syarifuddin and the Chairperson of the Attorney General Ag Burhanuddin. https://t.co/f1jo7rpk7v'),
(465, '2021-03-23 07:10:55', 'sentani_humas', 'JAKARTA - Kapolri Jenderal Listyo Sigit Prabowo meresmikan launching tilang elektronik atau Elektronic Traffic law enforcement (Etle) nasional tahap 1. Dalam launching tahap 1 ini, ada 12 Polda dengan 244 kamera tilang elektronik yang bakal dioperasikan mulai hari ini. https://t.co/s30nWE54f7', 'JAKARTA - National Police Chief Gen. Listyo Sigit Prabowo inaugurated the Launching of Electronic Traffic Law Enforcement (ETLE) Phase 1. In this stage 1 launching, there are 12 Polda with 244 electronic ticket cameras that will be operated starting today. https://t.co/s30nwe54f7'),
(466, '2021-03-23 03:21:26', 'SukamaraPolres', 'https://t.co/hDiuLzG3ju  Salam Keselamatan.. salam Presisi...\nKegiatan Launching ETLE Nasional oleh Korlantas polri secara virtual melalui zoom meeting.\n\n@Humas_Polda_Ktg \n@NTMCLantasPolri \n@DitlantasK \n@IndukSukamara https://t.co/tNQp4quWVs', 'https://t.co/hdiulzg3ju Salam Salvation .. Greetings precision ... \n National Launching Etle activities by the National Police Korlantas virtually through the Zoom Meeting. \n\n @Humas_polda_ktg \n @Ntmclantaspolri \n @Ditlantask \n @Induksukamara https://t.co/tnqp4quwvs'),
(467, '2021-03-22 15:36:28', 'satlantas_mglta', 'ETLE , Electronic Traffic Law  Enforcement\n\nLounching Nasional Selasa 23 Maret 2021 di NTMC #polri\nJakarta\n\nmemang benar membentuk kesadaran hukum tidak semudah bikin wedang #kopi\n\nnamun kami yakin pentingnya keselamatan adalah sebagai sebuah kebutuhan https://t.co/i41qDJ0GjY', 'ETLE, Electronic Traffic Law Enforcement \n\n National Lounching Tuesday 23 March 2021 at NTMC #Polri \n Jakarta \n\n It is true that forming legal awareness is not as easy as making wedang #kopi \n\n But we believe the importance of safety is as a need https://t.co/i41qdj0gjy'),
(468, '2021-03-22 05:18:05', 'satlantas_mglta', 'Jalan Lengang Belum Tentu Aman\n\nJaga Keselamatan dan Konsenterasi Anda Saat Berkendara\n#polripresisi #etle #roadsafety #korlantaspolriuntukindonesia #korpslalulintas #roadsafetyzeroaccident #dikmaslantaspolri #zeroaccident #rambulalulintas https://t.co/pyvFQoQSrf', 'Jalan Lengang is not necessarily safe \n\n Keep your safety and concentration while driving \n #Polripresisi #etle #roadsafety #korlantaspolri forindonesia #korpslalallalaluluahafetyzeroaccident #dikmaslantaspolri #zeroaccident #rambulalalintastan https://t.co/pyvfqoqsrf'),
(469, '2021-03-22 01:36:51', 'satlantas_mglta', 'H-1 menuju Launching ETLE NASIONAL tahap ke-1.\nYang akan di laksanakan pada hari Selasa, 23 Maret 2021 di NTMC POLRI JAKARTA melalui Video Conference yang diikuti oleh peserta dari seluruh jajaran POLDA di INDONESIA. \n\nReposted from @dtlpoldajateng https://t.co/VGQp47Fu7m', 'H-1 Towards Launching of the 1st Phase National Etle. \n Which will be held on Tuesday, March 23, 2021 at NTMC POLRI Jakarta through a video conference which was attended by participants from all ranks of the Regional Police in Indonesia. \n\n Reposted from @dtlpoldajateng https://t.co/vgqp47fu7m'),
(470, '2021-03-21 04:36:02', 'satlantas_mglta', 'H-2 menuju Launching ETLE NASIONAL tahap ke-1.\nYang akan di laksanakan pada hari Selasa, 23 Maret 2021 di NTMC POLRI JAKARTA melalui Video Conference yang diikuti oleh peserta dari seluruh jajaran POLDA di INDONESIA.  \n\nReposted from @dtlpoldajateng https://t.co/y9xuVWqf1O', 'H-2 to the 1st phase of the 1st National Etle Launching. \n Which will be held on Tuesday, March 23, 2021 at NTMC POLRI Jakarta through a video conference which was attended by participants from all ranks of the Regional Police in Indonesia. \n\n Reposted from @dtlpoldajateng https://t.co/y9xuvwqf1o'),
(471, '2021-03-21 03:18:13', 'lantas_semarang', 'Jangan lupa untuk selalu lengkapi surat¬≤ berkendaranya ya patuhi pula rambu¬≤ lalu lintasnya jgn sampai tertangkap pelanggaran melalui CCTV ETLE \nStop Pelanggaran, Stop Kecelakaan, Keselamatan untuk Kemanusiaan üòá https://t.co/7kUmCmIrug', 'Don\'t forget to always complete the driving letters, then obey the traffic signs, don\'t be caught in violations through CCTV Etle \n Stop violations, stop accidents, safety for humanity üòá https://t.co/7kumcmirug'),
(472, '2021-03-19 11:12:21', 'SyaripH78320748', 'Manfaat ETLE untuk masyarakat yaitu terwujudnya efektivitas Penegakan Hukum, jaminan asas transparansi, dan kepastian hukum yang dibuktikan secara Scientific berdasarkan rekaman hasil bukti pelanggaran.\n\nDemi Keselamatan Untuk Semua Ayo #PatuhBerlalulintas https://t.co/NoGFXwiGNh', 'Etle benefits for the community are the realization of the effectiveness of law enforcement, guarantee of the principle of transparency, and legal certainty that is proven scientifically based on recordings of the results of violations. \n\n For the sake of safety for all Come on #Patuh Belallalalulanastu https://t.co/nogfxwignh'),
(473, '2021-03-19 11:11:34', 'SyaripH78320748', 'Electronic Traffic Law Enforcement (ETLE) sistem penegakan hukum di bidang lalu lintas yang berbasis teknologi informasi, berupa kamera yang dapat mendeteksi pelanggaran lalulintas dan data kendaraan bermotor secara otomatis\n\nDemi Keselamatan Untuk Semua Ayo #PatuhBerlalulintas https://t.co/VDX2VC40Uf', 'Electronic Traffic Law Enforcement (ETLE) of law enforcement systems in the field of traffic based on information technology, in the form of cameras that can detect traffic violations and motor vehicle data automatically \n\n For the sake of safety for all Come on #Patuh Belallalalulanastu https://t.co/vdx2vc40uf'),
(474, '2021-03-19 10:58:59', 'SyaripH78320748', 'Korlantas Polri meluncurkan empat program berbasis digital dalam peningkatan pelayanan publik. Keempat program unggulan tersebut adalah ETLE (electronic traffic law envorcment), perpanjangan SIM A dan C online, Pembuatan SIM online dan Samsat digital. \n\n#PatuhBerlalulintas https://t.co/vSQ570Y3DF', 'Korlantas Polri launched four digital -based programs in improving public services. The four excellent programs are ETLE (Electronic Traffic Law Envorcment), the extension of SIM A and C Online, Making Online SIMs and Digital Samsat. \n\n #PATUBBERLLALULASTAS https://t.co/vsq570y3df'),
